import React, { useState } from 'react';
import BotaoMenu from "./componentes/BotaoMenu";

function App(props) {

  function qualBotao(titulo){
    console.log(titulo);
  }

  return (
    <div>
      <div className="centralizado">
        <p className="titulo">Clínica Integrità</p>
        <BotaoMenu onClick={qualBotao} titulo="Agenda"></BotaoMenu>
        <BotaoMenu onClick={qualBotao} titulo="Cadastro Paciente"></BotaoMenu>
        <BotaoMenu onClick={qualBotao} titulo="Avaliação Acupuntura"></BotaoMenu>
        <BotaoMenu onClick={qualBotao} titulo="Mensalidade"></BotaoMenu>
      </div>
    </div>
  );
}

export default App;
